import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <nav className="bg-[#800000] text-white p-4 shadow-md">
      <div className="max-w-7xl mx-auto flex items-center justify-between">
        {/* Logo */}
        <div className="flex items-center space-x-2">
          <img src="../images/Logo.png" alt="Logo" className="h-10 w-auto" />
          <span className="text-xl font-bold">GesPrac</span>
        </div>

        {/* Botón Hamburguesa */}
        <div className="md:hidden">
          <button onClick={() => setMenuOpen(!menuOpen)} className="focus:outline-none">
            <svg className="w-6 h-6" fill="none" stroke="currentColor" strokeWidth={2}
              viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round"
                d={menuOpen ? "M6 18L18 6M6 6l12 12" : "M4 6h16M4 12h16M4 18h16"} />
            </svg>
          </button>
        </div>

        {/* Menú para pantallas grandes */}
        <div className="hidden md:flex space-x-6">
          <Link to="/" className="hover:underline">Inicio</Link>
          <Link to="/normativa" className="hover:underline">Normativa</Link>
          <Link to="/login" className="hover:underline">Login</Link>
        </div>
      </div>

      {/* Menú desplegable para móvil */}
      {menuOpen && (
        <div className="md:hidden mt-2 space-y-2 px-4">
          <Link to="/" className="block hover:underline">Inicio</Link>
          <Link to="/normativa" className="block hover:underline">Normativa</Link>
          <Link to="/login" className="block hover:underline">Login</Link>
        </div>
      )}
    </nav>
  );
};
